full_reasoning:
Step-by-step reasoning:
1. Key psychological mechanisms: In responder decisions (akin to the ultimatum game), participants care not only about their absolute gain (the proposed split_self) but also about fairness or inequity relative to a fairness benchmark. In our context, this benchmark is naturally defined by the ratio of the tokens found in the pretask, with the fair share computed as a proportion of the combined earnings.

2. How these mechanisms interact: The participant compares the offered split (split_self) to a fairness reference computed as follows:
  fair_share = combined_earning × (token_self / (token_self + token_opp))
If the offer is below this fair share, the utility is penalized (disadvantageous inequity). If the offer exceeds it, the excess may be discounted as an “unfair advantage” (advantageous inequity) though many responders tend to avoid overly generous splits as they might signal other social dynamics. Thus, the utility of accepting the offer is modeled as the monetary gain (split_self) reduced by a penalty for deviation from the fairness reference point.

3. Mathematical form: We adopt a piecewise linear utility function similar to the Fehr–Schmidt inequity aversion model. The utility of accepting is given by:
  U(accept) = split_self − α · max(fair_share − split_self, 0) − β · max(split_self − fair_share, 0)
Here, α quantifies sensitivity to disadvantageous inequity (when the offer is less than fair share) and β quantifies sensitivity to advantageous inequity (when the offer is more generous than the fairness benchmark).

4. Learnable parameters: We have two learnable parameters: α and β. Their finite bounds are chosen generously (e.g., between 0 and 10). Both parameters directly modulate the penalty for deviations from fairness.

5. Mapping to observable behavior: In each trial, the model uses the observed values of split_self, token_self, token_opp, and combined_earning (all available in the dataset) to compute the fairness reference and then the utility of accepting. A negative utility indicates the offer is perceived as very unfair, reducing the likelihood of acceptance.

Below is the formal model specification and variable descriptions.

<MODEL>
Let fair_share = combined_earning * token_self / (token_self + token_opp)
U = split_self - alpha * max(fair_share - split_self, 0) - beta * max(split_self - fair_share, 0)
</MODEL>

